webpackJsonp([0xdd67dfd12506],{3437:function(n,t){n.exports={data:{markdownRemark:{html:"<p>分かりやすく言うと“迷路ツクール”。\nまずエディット画面で迷路を作り、ゲーム画面でプレイすると言ったものです。</p>\n<p>しかしそれだけでは味がないと思ってつけたのが<em>『ゴールを隠す』</em>と言ったもの。\nゴールについてもわざわざ調べるコマンドを使わないとゴールできず、しかも3回ゴールポイントを誤るとゲームオーバー。\nもはや誰もクリア出来ないと言う<strong>自分の人生史上最悪の自作ゲーム</strong>となりました。</p>\n<p>……あぁ怖い怖い(笑</p>\n<ul>\n<li>ジャンル: ゲームコンストラクション</li>\n<li>開発言語: N88-日本語BASIC(86)</li>\n<li>推奨環境: intel 80286 12MHz以上</li>\n<li>ソース紛失のため頒布はありません。</li>\n</ul>",frontmatter:{cover:null,date:"1995-10-01T00:00:00+09:00",strDate:"1995/9/30",title:"DANGEON MAKER"}}},pathContext:{path:"/ja/blog/1995/10/01-dangeon-maker/",langKey:"ja"}}}});
